import { Button, Container, Dialog, DialogTitle } from '@mui/material';
import React, { useState } from 'react';
import BaseAdminView from '../BaseAdminView/BaseAdminView';
import DataTable from "../DataTable/DataTable";

const tableHeaders = ["image", "name", "Status", "Active"];

const AdminPaymentMethod = () => {
  const [open, setOpen] = useState(false);
  const [userRows, setUsersRows] = useState([]);

  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };
  return (
    <BaseAdminView>
        <Button
        variant="contained"
        color="secondary"
        display="flex"
        sx={{
            left: '30px',
            width:'133px',
            height:'40px',
            mt:'20px',
            mb:'10px'

        }}
        onClick={handleClickOpen}
        >Add User</Button>
        <Dialog 
        open={open}
        onClose={handleClose}>
          <DialogTitle fontFamily='Poppins' textAlign="center" >Add New Payment Method</DialogTitle>
          Halo Halo
        </Dialog>
        <DataTable headers={tableHeaders}  rows={userRows}/>

    </BaseAdminView>
  )
}

export default AdminPaymentMethod
